import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const LoginPage = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("user");
  const [showPassword, setShowPassword] = useState(false);

  const handleTogglePassword = () => {
    setShowPassword(!showPassword);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (email === "" || password === "") {
      alert("Please fill in all fields.");
      return;
    }

    console.log("Login Info:");
    console.log("Email: " + email);
    console.log("Password: " + password);
    console.log("Role: " + role);
  };

  return (
    <>
      {/* Import Google Font Poppins */}
      <link
        href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;500;600;700&display=swap"
        rel="stylesheet"
      />

      {/* Import Font Awesome (v6) - Updated Link */}
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css"
        integrity="sha512-Fo3rlrZj/k7ujTnHg4C+2X1kzKxE2Y3d2MqFde1P/o4hffjKpsUBlZB6ZFJRFonhXXewkO1l1LJB5y+1lB+fhw=="
        crossOrigin="anonymous"
        referrerPolicy="no-referrer"
      />

      <div className="min-h-screen flex" style={{ fontFamily: "'Poppins', sans-serif" }}>
        {/* Left Section with Image Background */}
        <div className="relative w-1/2">
          <img
            src="background.jpg"
            alt="Background Image"
            className="w-full h-full object-cover"
          />

          {/* New Semi-transparent Container */}
          <div className="absolute top-0 left-0 w-full h-full bg-black bg-opacity-50 flex flex-col justify-center items-center">
            {/* Container that matches the uploaded image style */}
            <div className="bg-white bg-opacity-70 p-8 rounded-lg text-center shadow-lg">
              <img
                src="/mnt/data/Screenshot 2024-09-19 144731.png"
                alt="Uploaded"
                className="w-20 h-20 mb-4"
              />
              <h2 className="text-3xl text-black font-bold mb-2">Nama Website</h2>
              <p className="text-black text-lg">Jelajahi ribuan footage menarik di website kami!</p>
            </div>
          </div>
        </div>

        {/* Right Section for Login Form */}
        <div className="w-1/2 bg-gray-800 flex flex-col justify-center items-center p-10">
          <h1 className="text-4xl text-white mb-4 font-bold">Selamat Datang!</h1>
          <p className="text-lg text-white mb-8">
            Jelajahi ribuan footage menarik di website kami!
          </p>

          <form onSubmit={handleSubmit} className="w-full">
            <label htmlFor="email" className="block text-white mb-2">
              Email / username
            </label>
            <input
              type="text"
              id="email"
              name="email"
              placeholder="Masukkan email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="w-full p-3 mb-4 rounded bg-white text-black"
            />

            <label htmlFor="password" className="block text-white mb-2">
              Password
            </label>
            <div className="relative mb-4">
              <input
                type={showPassword ? "text" : "password"}
                id="password"
                name="password"
                placeholder="Masukkan password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                className="w-full p-3 rounded bg-white text-black pr-12"
              />
              <i
                className={`fa-solid ${showPassword ? "fa-eye-slash" : "fa-eye"} absolute right-3 top-1/2 transform -translate-y-1/2 text-gray-500 cursor-pointer`}
                onClick={handleTogglePassword}
              ></i>
            </div>

            <label htmlFor="role" className="block text-white mb-2">
              Pilih Role
            </label>
            <select
              id="role"
              name="role"
              value={role}
              onChange={(e) => setRole(e.target.value)}
              className="w-full p-3 mb-4 rounded bg-gray-600 text-white"
            >
              <option value="user">User</option>
              <option value="admin">Admin</option>
              <option value="super-admin">Super Admin</option>
            </select>

            <a href="LupaPassword.jsx" className="block text-right text-red-500 text-sm mb-4">
              <Link to="/lupa-password">Lupa Password?</Link>
            </a>

            <button
              type="button"
              className="w-full bg-gray-300 text-black font-bold py-3 rounded flex items-center justify-center mb-4"
            >
              <img
                src="google.png"
                alt="Google Logo"
                className="w-5 h-5 mr-2"
              />
              Masuk menggunakan Google
            </button>

            <button
              type="submit"
              className="w-full bg-blue-600 text-white font-bold py-3 rounded"
            >
              <a href="MainPage.jsx">Masuk</a>
            </button>
          </form>

          <p className="text-white mt-4 font-bold">
            Belum punya akun?{" "}
            <a href="DaftarAkun1.jsx" className="text-red-500">
              <Link to="/daftar-akun1">Daftar</Link>
            </a>
          </p>
        </div>
      </div>
    </>
  );
};

export default LoginPage;
